INSERT OR REPLACE INTO survey_answers (id, response_id, question_id, answer_text, answer_numeric, answer_boolean, answer_date, is_empty, created_at) VALUES (962, 31, 107, 'I''m so excited to get started! We have a LOT to explore. One andecdote re: AI - I''m sure you''re already hearing similar stories, but with AI previews on Google, our organic traffic has been dramatically reduced as individuals no longer need to click through to read content. Industry estimates are pointing to a 60% reduction overall. I was chatting with our marketing teammate last week and we agreed that for a web product, AI is having as much as an impact as Oct 7 has had for the Jewish world.', NULL, NULL, NULL, 0, '2025-09-23 21:14:49');
